const CartList = ({ cartItems }) => {
  const [data, setData] = useState([]);
  
  useEffect(() => {
    setData(cartItems);
  }, []);

  const totalPrice = data.reduce((total, e) => total + e.price, 0);

   
  
}

export default CartList;
